import React from "react";
import "./Hotels.css";
const Hotels = () => {
  const array3 = [
    {
      name: "Aparthotel Stare Miasto",
      city: "Madrid",
      price: 120,
      rate: 8.9,
      type: "Excellent",
      image_url: "./images/hotel_1.webp",
    },
    {
      name: "Comfort Suites Airport",
      city: "Austin",
      price: 140,
      rate: 9.3,
      type: "Exceptional",
      image_url: "./images/hotel_2.jpg",
    },
    {
      name: "Four Seasons Hotel",
      city: "Lisbon",
      price: 99,
      rate: 8.8,
      type: "Excellent",
      image_url: "./images/hotel_3.jpg",
    },
    {
      name: "Hilton Garden Inn",
      city: "Berlin",
      price: 105,
      rate: 8.9,
      type: "Excellent",
      image_url: "./images/hotel_4.jpg",
    },
  ];

  return (
    <div>
      <h2>Homes guests love</h2>
      <div>
        {array3.map((array3, index) => (
          <div>
            <img src={array3.image_url} alt={array3.index} />
            <h3>{array3.name}</h3>
            <h4>{array3.city}</h4>
            <h4>
              starting from<span>{array3.price}$</span>
            </h4>
            <h5>
              {array3.rate}
              <></> {array3.type}
            </h5>
          </div>
        ))}
      </div>
    </div>
  );
};
export default Hotels;
